export const ContactPicker = ({
name,

handleSubmit,
contact



}) => {


 contact.map(info=>info.name)

  return (
    <div>


<select onChange={handleSubmit} name={name}  >


<option value="">

No Contact Selected

</option>

{contact.map((name)=>{
 return 
 <option key={name} value={name}>{name}</option>

})
}



</select>




    </div>
  );
};
